// material-ui
import { useState, useRef, useEffect } from 'react';
import {
    Avatar,
    Drawer,
    Fab,
    FormControl,
    FormControlLabel,
    Grid,
    IconButton,
    Radio,
    RadioGroup,
    Slider,
    Tooltip,
    Typography
} from '@mui/material';
import { useTheme } from '@mui/material/styles';
// project imports
import MainCard from 'ui-component/cards/MainCard';
import User1 from 'assets/images/users/user-round.svg';
// ==============================|| SAMPLE PAGE ||============================== //

const Profile = () => {
    const theme = useTheme();
    const anchorRef = useRef(null);
    return (
        <Grid container spacing={2}>
            <Grid item xs={12}>
                <MainCard>
                    <Typography
                        style={{
                            textAlign: 'center',
                            fontSize: '2.5rem',
                            fontWeight: 'bold',
                            marginBottom: '1.5rem'
                        }}
                        variant="h1"
                    >
                        Profile
                    </Typography>
                    <Avatar
                        src={User1}
                        sx={{
                            ...theme.typography.mediumAvatar,
                            // margin: '8px 0 8px 8px !important',
                            cursor: 'pointer',
                            // Increase size
                            width: '100%',
                            height: '100%',
                            //center
                            display: 'block',
                            margin: '0 auto'
                        }}
                        ref={anchorRef}
                        // aria-controls={open ? 'menu-list-grow' : undefined}
                        aria-haspopup="true"
                        color="inherit"
                    />
                </MainCard>
            </Grid>
        </Grid>
    );
};

export default Profile;
